//     activeItem[0].classList.remove('active');
//   }
//   const listing = document.getElementById(`listing-${marker.id}`);
//   listing.classList.add('active');

//   // Set scrollbar in the centre when clicked
//   listing.scrollIntoView({
//     block: 'center',
//   });
// });

// click on list
// link.addEventListener('click', function () {
//   for (const feature of sortedArray) {
//     if (this.id === `link-${feature.id}`) {
//       munroSearch.value = '';
//       currentMunro.flyToMunro(feature);

//       currentMunro.createPopUp(feature);
//     }
//   }

//   const activeItem = document.getElementsByClassName('active');
//   if (activeItem[0]) {
//     activeItem[0].classList.remove('active');
//   }
//   this.parentNode.classList.add('active');
// });

class App {
  #munrosList;
  constructor() {
    this.#munrosList = [];
  }
  // 1. Show spinner untill _getMap & _getMunrosList received.ok
  _showSpinner() {}

  // 2. Get data from Mapbox
  _getMap() {}

  // 3. Get data from Munros API
  _getMunrosList() {}

  // 4. Render map
  _showMap() {}

  // 5. Render list
  _showList() {}
}
const test = new App();

class Map {
  constructor() {}

  // 1. Render markers on Map
  _addMarkers() {}

  // 2. User click on possition on MunroList. Fly to marker and zoomIn.
  _flyToMunro() {}

  // 3. Get data from clicked position, fing in Munros Array and render popup on the map.
  _createPopUp() {}
}

class List {
  constructor() {}

  // 1. Sort the list of munros by Name, Height, Region
  _sortMunros() {}

  // 2. Search and then update _showList and instant render.
  _searchMunros() {}
}

function spinner(para) {
  if (para === 1) {
    spinnerEl.classList.add('spinner-show');
    spinnerBgEl.classList.add('spinner-background');
  }
  if (para === 0) {
    spinnerEl.classList.remove('spinner-show');
    spinnerBgEl.classList.remove('spinner-background');
  }
}

const getMap = function () {
  mapboxgl.accessToken = MAP_KEY;
  return new mapboxgl.Map({
    container: 'map',
    style: MAP_STYLE,
    center: MAP_CENTER,
    zoom: MAP_ZOOM,
  });
};
const map = getMap();

const renderMap = function () {
  map.on('load', () => {
    map.addSource(
      'dem',
      {
        type: 'raster-dem',
        url: 'mapbox://mapbox.mapbox-terrain-dem-v1',
      },
      'places',
      {
        type: 'geojson',
        data: munrosList,
      }
    );
    map.addLayer(
      {
        id: 'hillshading',
        source: 'dem',
        type: 'hillshade',
      },
      'waterway-river-canal-shadow'
    );
  });
};

// Tutaj trzeba zrobić, żeby przyjmował koordynaty przekazanae przy kliknieciu do _flyTo
const renderMap2 = function (cords) {
  map.addSource('route', {
    type: 'geojson',
    data: {
      type: 'Feature',
      properties: {},
      geometry: {
        type: 'LineString',
        coordinates: cords,
      },
    },
  });
  map.addLayer({
    id: 'route',
    type: 'line',
    source: 'route',
    layout: {
      'line-join': 'round',
      'line-cap': 'round',
    },
    paint: {
      'line-color': '#888',
      'line-width': 8,
    },
  });
};

class DisplayOnMap {
  flyToMunro(currentMunro) {
    map.flyTo({
      center: currentMunro.coordinates,
      zoom: MAP_FLYTO_ZOOM,
    });
  }

  createPopUp(currentMunro) {
    const popUps = document.getElementsByClassName('mapboxgl-popup');
    /** Check if there is already a popup on the map and if so, remove it */
    if (popUps[0]) popUps[0].remove();

    // Create popup
    const popup = new mapboxgl.Popup({ closeOnClick: true })
      .setLngLat(currentMunro.coordinates)
      .setHTML(
        `<h3>${currentMunro.name}</h3>
        <h4>"${currentMunro.meaning}"</h4>
        <p>Height: ${currentMunro.height} m<br>
        ${currentMunro.region}
        </p>`
      )
      .addTo(map);

    const closeBtn = document.querySelector('.mapboxgl-popup-close-button');
